// import Link from "next/link";

const linkStyle = {
  marginRight: 15,
};

const Header = () => (
  <>
    <header>
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Work</li>
        <li>Contact</li>
      </ul>
    </header>
    <style>
      {`
        ul {
          display: flex;
        }
      `}
    </style>
  </>
);

export default Header;
